import * as React from 'react';

interface Props {
    title: string;
}

const myStyle = {
    color: '#0000FF'
};

export const SideBarHeader: React.FC<Props> = ({title}) => {
    // const [title, setTitle] = React.useState('')

    return (
        <div>
            <h3 style={myStyle}>
                {title}
            </h3>
        </div>
    );
};
